import React from 'react';
import {Box, Grid, FilledInput, Select, MenuItem, Dialog, DialogTitle, DialogContent, DialogAction} from '@material-ui/core';

export default (props)=>{
    return (
        <Dialog open={true} fullWidth>
            <DialogTitle>Post a Sponsor</DialogTitle>
            <DialogContent>
                <Grid container spacing={2}>
                <Grid item xs={6}>
                    <FilledInput placeholder='Title' disableUnderline fullWidth/>
                </Grid>
                <Grid item xs={6}>
                    <FilledInput placeholder='Title' disableUnderline fullWidth/>
                </Grid>
                </Grid>
            </DialogContent>
        </Dialog>
    )
}
